INSERT INTO `v1_90f5a76eda8df2745cea5e8cb9c236dc9714e000a35ac2deaa201504350320dc` VALUES (16612026, 0.5, "ふふ、やった！　やったぞ！\nまたしても傑作の完成だ！\nみんなの努力が実る、この瞬間……\n何度やっても達成感があるな！", 0, 16612, 1, 11, 0, 100911, 10, 1);
