INSERT INTO `v1_90f5a76eda8df2745cea5e8cb9c236dc9714e000a35ac2deaa201504350320dc` VALUES (16612031, 0.5, "ちょ、ちょっとアンナさん……\nあなた全身、絵の具だらけで\n動くたびに飛び散ってますわ。\n少し大人しくしてもらえますか？", 0, 16612, 1, 11, 0, 102711, 10, 1);
