INSERT INTO `v1_90f5a76eda8df2745cea5e8cb9c236dc9714e000a35ac2deaa201504350320dc` VALUES (16612036, 0.5, "あははっ！　そういうエリコ様も\nおててが絵の具だらけでござるよ～！\nむふふ、いわゆるギャップ萌え\nというやつですな？", 0, 16612, 1, 11, 0, 101311, 10, 1);
